// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract FarmerRegistry {
    struct TreeData {
        string ipfsHash; // IPFS metadata link
        uint256 timestamp;
        bool verified; // To be set true after AI/3D verification
    }

    struct Farmer {
        string name;
        string location;
        uint256 totalTrees;
        mapping(uint256 => TreeData) trees;
    }

    mapping(address => Farmer) public farmers;
    address public admin;

    event FarmerRegistered(address indexed farmer, string name, string location);
    event TreeRegistered(address indexed farmer, uint256 indexed treeId, string ipfsHash);
    event TreeVerified(address indexed farmer, uint256 indexed treeId);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Not authorized");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    function registerFarmer(string memory _name, string memory _location) external {
        Farmer storage f = farmers[msg.sender];
        require(bytes(f.name).length == 0, "Already registered");
        f.name = _name;
        f.location = _location;
        emit FarmerRegistered(msg.sender, _name, _location);
    }

    function registerTree(string memory _ipfsHash) external {
        Farmer storage f = farmers[msg.sender];
        require(bytes(f.name).length != 0, "Farmer not registered");
        uint256 treeId = f.totalTrees++;
        f.trees[treeId] = TreeData(_ipfsHash, block.timestamp, false);
        emit TreeRegistered(msg.sender, treeId, _ipfsHash);
    }

    function verifyTree(address _farmer, uint256 _treeId) external onlyAdmin {
        Farmer storage f = farmers[_farmer];
        f.trees[_treeId].verified = true;
        emit TreeVerified(_farmer, _treeId);
    }
}
